import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 33.2-2300 U.S. Route 58 Corridor Development Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-2300.md","filePath":"vacode/33.2-2300.md"}'),n={name:"vacode/33.2-2300.md"},o=a('<h1 id="§-33-2-2300-u-s-route-58-corridor-development-fund" tabindex="-1">§ 33.2-2300 U.S. Route 58 Corridor Development Fund. <a class="header-anchor" href="#§-33-2-2300-u-s-route-58-corridor-development-fund" aria-label="Permalink to &quot;§ 33.2-2300 U.S. Route 58 Corridor Development Fund.&quot;">​</a></h1><p>There is hereby created in the Department of the Treasury a special nonreverting fund that shall be a part of the Transportation Trust Fund and that shall be known as the U.S. Route 58 Corridor Development Fund, referred to in this chapter as &quot;the Fund,&quot; consisting of the $40 million of annual collections from the Commonwealth Transportation Fund pursuant to § <a href="/vacode/33.2-1524/">33.2-1524</a>. The Fund shall also include such other funds as may be appropriated by the General Assembly and designated for the Fund and all interest, dividends, and appreciation that may accrue thereto. Any moneys remaining in the Fund at the end of a biennium shall not revert to the general fund, but shall remain in the Fund. Allocations from the Fund may be paid to any authority, locality, or commission for the purposes specified in § <a href="/vacode/33.2-2301/">33.2-2301</a>.</p><p>1989, c. 286, § 58.1-815; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0256" target="_blank" rel="noreferrer">256</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1230" target="_blank" rel="noreferrer">1230</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1275" target="_blank" rel="noreferrer">1275</a>.</p>',3),i=[o];function l(s,d,h,c,u,p){return t(),r("div",null,i)}const m=e(n,[["render",l]]);export{_ as __pageData,m as default};
